import React, { Component } from 'react';

import face from '../image/pic1.jpg'


export class Home extends Component{
  render(){

    return (



    	<div className="test">
			<img src= {face} alt="185"/>

			<h1>Welcome to Zhijun Yan's assignment page of CS185</h1>
			<h2>Assignment 1: Done 
			Assignment 2: Done
			Assignment 3: Done
			Assignment 4: Done
			Assignment 5: T.B.A
			Assignment 6: T.B.A
			Assignment 7: T.B.A
			Assignment 1: T.B.A</h2>

    	</div>
    	);


  }

}


export default Home;
